import AddLibro from "views/AddLibro"; // Asegúrate de importar el componente AddLibro

var dashRoutes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "design_app",
    component: <Dashboard />,
    layout: "/admin",
  },
  {
    path: "/icons",
    name: "Icons",
    icon: "design_image",
    component: <Icons />,
    layout: "/admin",
  },
  {
    path: "/maps",
    name: "Maps",
    icon: "location_map-big",
    component: <Maps />,
    layout: "/admin",
  },
  {
    path: "/notifications",
    name: "Notifications",
    icon: "ui-1_bell-53",
    component: <Notifications />,
    layout: "/admin",
  },
  {
    path: "/user-page",
    name: "Agregar Autor",
    icon: "users_single-02",
    component: <UserPage />,
    layout: "/admin",
  },
  {
    path: "/extended-tables",
    name: "Lista de Autores",
    icon: "files_paper",
    component: <TableList />,
    layout: "/admin",
  },
  {
    path: "/typography",
    name: "Buscar Autor",
    icon: "design-2_ruler-pencil",
    component: <Typography />,
    layout: "/admin",
  },
  {
    path: "/add-libro",
    name: "Agregar Libro",
    icon: "education_agenda-bookmark", // Elige un ícono adecuado
    component: <AddLibro />,
    layout: "/admin",
  },
  {
    pro: true,
    path: "/upgrade",
    name: "Upgrade to PRO",
    icon: "objects_spaceship",
    component: <Upgrade />,
    layout: "/admin",
  },
];
export default dashRoutes;
